import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Dashboard.css';

const Dashboard = function() {
  const navigate = useNavigate();

  const handleLogout = function() {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return React.createElement(
    'div',
    { className: 'dashboard-container' },
    React.createElement(
      'aside',
      { className: 'sidebar' },
      React.createElement('h2', null, 'Finansal Analiz'),
      React.createElement(
        'nav',
        null,
        React.createElement(
          'ul',
          null,
          React.createElement(
            'li',
            null,
            React.createElement(Link, { to: '/transactions' }, 'Gelir/Gider İşlemleri')
          ),
          React.createElement(
            'li',
            null,
            React.createElement(Link, { to: '/recommendation' }, 'Yatırım Önerileri')
          )
        )
      )
    ),
    React.createElement(
      'div',
      { className: 'main-content' },
      React.createElement(
        'header',
        { className: 'dashboard-header' },
        React.createElement('h1', null, 'Dashboard'),
        React.createElement(
          'button',
          { className: 'logout-button', onClick: handleLogout },
          'Çıkış Yap'
        )
      ),
      React.createElement(
        'section',
        { className: 'overview' },
        React.createElement(
          'div',
          { className: 'card' },
          React.createElement('h3', null, 'Toplam Gelir'),
          React.createElement('p', null, '₺10,000')
        ),
        React.createElement(
          'div',
          { className: 'card' },
          React.createElement('h3', null, 'Toplam Gider'),
          React.createElement('p', null, '₺7,500')
        ),
        React.createElement(
          'div',
          { className: 'card' },
          React.createElement('h3', null, 'Kalan Bakiye'),
          React.createElement('p', null, '₺2,500')
        )
      ),
      React.createElement(
        'section',
        { className: 'charts' },
        React.createElement(
          'div',
          { className: 'chart-card' },
          React.createElement('h3', null, 'Gelir/Gider Grafiği'),
          React.createElement('div', { className: 'chart-placeholder' }, '[Chart]')
        ),
        React.createElement(
          'div',
          { className: 'chart-card' },
          React.createElement('h3', null, 'Yatırım Önerileri'),
          React.createElement('div', { className: 'chart-placeholder' }, '[Chart]')
        )
      )
    )
  );
};

export default Dashboard;
